import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Modal from '@mui/material/Modal';

import passwordRules from '../rules';
import Rule from '../component/RuleUI';

export default function BasicTextFields() {
    const [searchTerm, setSearchTerm] = useState('');
    const [gameOver, setGameOver] = useState(false);
    const [rulesChecker, setRulesChecker] = useState(Array(20).fill(0));
    const X = 10;
    let rulesCounter = 0;
    const [rulesComponents, setRulesComponents] = useState([]);
    const [open, setOpen] = useState(false);
    const [inputLetters, setInputLetters] = useState('');
    const [forbiddenLetters, setForbiddenLetters] = useState(['a', 'e', 'i', 'o', 'u']);
    const[newRulesComponents,setNewRulesComponents]=useState([]);

    const handleSearch = (e) => {
        const inputValue = e.target.value;
        if (inputValue.toLowerCase().includes('cheat')) {
            setSearchTerm(passwordRules.cheatPassword());
        } else {
            setSearchTerm(inputValue);
        }
    };

    const checkRules = (words) => {
        // const newRulesComponents = [];
        let allRulesPassed = true;
        newRulesComponents.push(<Rule key={1} index={1} text="Your password must be at least 5 characters." passed={false} />);
        // Rule 1
        if (passwordRules.rule1(words)) {
            console.log('Rule 1 passed: Length greater than 5');
            rulesChecker[0] = 1;
            newRulesComponents.push(<Rule key={1} index={1} text="Your password must be at least 5 characters." passed={true} />);
        } else {
            console.log('Rule 1 failed: Length not greater than 5');

            allRulesPassed = false;
        }

        // Rule 2
        if (allRulesPassed && passwordRules.rule2(words)) {
            console.log('Rule 2 passed: Contains at least one digit');
            rulesChecker[1] = 1;
            newRulesComponents.push(<Rule key={2} index={2} text="Your password must include a number." passed={true} />);
        } else {
            if (allRulesPassed) {
                console.log('Rule 2 failed: Does not contain any digit');
                newRulesComponents.push(<Rule key={2} index={2} text="Your password must include a number." passed={false} />);
            }
            allRulesPassed = false;
        }

        // Rule 3
        if (allRulesPassed && passwordRules.rule3(words)) {
            console.log('Rule 3 passed: Contains at least one uppercase letter');
            rulesChecker[2] = 1;
            newRulesComponents.push(<Rule key={3} index={3} text="Your password must include an uppercase letter." passed={true} />);
        } else {
            if (allRulesPassed) {
                console.log('Rule 3 failed: Does not contain any uppercase letter');
                newRulesComponents.push(<Rule key={3} index={3} text="Your password must include an uppercase letter." passed={false} />);
            }
            allRulesPassed = false;
        }

        // Rule 4
        if (allRulesPassed && passwordRules.rule4(words)) {
            console.log('Rule 4 passed: Contains non-alphanumeric characters');
            rulesChecker[3] = 1;
            newRulesComponents.push(<Rule key={4} index={4} text="Your password must include a non-alphanumeric character." passed={true} />);
        } else {
            if (allRulesPassed) {
                console.log('Rule 4 failed: Does not contain non-alphanumeric characters');
                newRulesComponents.push(<Rule key={4} index={4} text="Your password must include a non-alphanumeric character." passed={false} />);
            }
            allRulesPassed = false;
        }

        // Rule 5
        if (allRulesPassed && passwordRules.rule5(words, X)) {
            console.log(`Rule 5 passed: Sum of digits equals ${X}`);
            rulesChecker[4] = 1;
            newRulesComponents.push(<Rule key={5} index={5} text={`Sum of digits must equal ${X}`} passed={true} />);
        } else {
            if (allRulesPassed) {
                console.log(`Rule 5 failed: Sum of digits does not equal ${X}`);
                newRulesComponents.push(<Rule key={5} index={5} text={`Sum of digits must equal ${X}`} passed={false} />);
            }
            allRulesPassed = false;
        }

        // Rule 6
        if (allRulesPassed && passwordRules.rule6(words)) {
            console.log('Rule 6 passed: Contains month names');
            rulesChecker[5] = 1;
            newRulesComponents.push(<Rule key={6} index={6} text="Your password must include a month name." passed={true} />);
        } else {
            if (allRulesPassed) {
                console.log('Rule 6 failed: Does not contain month names');
                newRulesComponents.push(<Rule key={6} index={6} text="Your password must include a month name." passed={false} />);
            }
            allRulesPassed = false;
        }

        // Rule 7
        if (allRulesPassed && passwordRules.rule7(words)) {
            console.log('Rule 7 passed: Contains Roman numerals');
            rulesChecker[6] = 1;
            newRulesComponents.push(<Rule key={7} index={7} text="Your password must include a Roman numeral." passed={true} />);
        } else {
            if (allRulesPassed) {
                console.log('Rule 7 failed: Does not contain Roman numerals');
                newRulesComponents.push(<Rule key={7} index={7} text="Your password must include a Roman numeral." passed={false} />);
            }
            allRulesPassed = false;
        }

        // Rule 8
        if (allRulesPassed && passwordRules.rule8(words, passwordRules.countries)) {
            console.log('Rule 8 passed: Contains country names');
            rulesChecker[7] = 1;
            newRulesComponents.push(<Rule key={8} index={8} text="Your password must include a country name." passed={true} />);
        } else {
            if (allRulesPassed) {
                console.log('Rule 8 failed: Does not contain country names');
                newRulesComponents.push(<Rule key={8} index={8} text="Your password must include a country name." passed={false} />);
            }
            allRulesPassed = false;
        }

        // Rule 9
        if (allRulesPassed && passwordRules.rule9(words, X)) {
            console.log(`Rule 9 passed: Product of Roman numerals equals ${X}`);
            rulesChecker[8] = 1;
            newRulesComponents.push(<Rule key={9} index={9} text={`Product of Roman numerals must equal ${X}`} passed={true} />);
        } else {
